package com.shopping;

import java.util.Base64;
import java.nio.file.Files;
import java.nio.file.Path;
import java.nio.file.Paths;

public class Base64Detect {
    public static boolean isBase64(String input) {
        try {
            Base64.getDecoder().decode(input);
            return true;
        } catch (IllegalArgumentException e) {
            return false;
        }
    }
    public static boolean isPath(String input) {
        Path path = Paths.get(input);
        return Files.exists(path);
    }
    
    public static void main(String[] args) {
        String base64String = "SGVsbG8gd29ybGQh"; // Chuỗi Base64 hợp lệ
        String nonBase64String = "/imgs/book1.jpg"; // Chuỗi không phải là Base64
        String inputString = "";
        System.out.println(nonBase64String.startsWith("/imgs/"));
        System.out.println(isBase64(base64String)); // Kết quả: true
        System.out.println(isBase64(nonBase64String)); // Kết quả: false
        System.out.println(isBase64(inputString));
        System.out.println(Base64.getDecoder().decode((inputString)));
        
        String validPath = "../shopping_fe/public/imgs/book1.jpg"; // Đường dẫn hợp lệ

        System.out.println(isPath(validPath)); // Kết quả: true
        
        try {
            Path currentDirectory = Paths.get("").toAbsolutePath();
            System.out.println("Current directory: " + currentDirectory);

            System.out.println("Files in current directory:");
            Files.list(currentDirectory)
                    .filter(Files::isRegularFile)
                    .forEach(System.out::println);
        } catch (Exception e) {
            System.out.println("An error occurred: " + e.getMessage());
        }
    }
}